import React, { Component } from 'react';
import { breakfast } from "./breakfast.json";


class CreateBreakfast extends Component {
    constructor(props){
      super(props);
      this.state={
        breakfast: breakfast,
        printMenu:false,
      };
    }
    _printMenu = (bool) => {
      this.setState({
        printMenu: bool
      });
    }
  
    render() {
  
    const menu = this.state.breakfast.map((food,i)=>{
      return(
        <div className="container">
          <div className="row mt-4">
            <div className="col-m d-4">
              <div className="card mt-4">
                <div className="card-header">
                  <h3>{food.name}</h3>
                </div>
                <div className="card-body">
                  <p>{food.price}</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      )
    })
      return (
        <div className="menu">
          <div>
            <button onClick={this._printMenu.bind(null, true)}>DESAYUNO</button>
            { this.state.printMenu && <div>{menu}</div> }
          </div>
        </div>
      );
    }
  }
  export default CreateBreakfast;
